@emanuelefiano ha mandato avanti il gruppo @pdnetwork in Aula per tutta la legislatura, con impegno e fatica, nella gioia e nel dolore, in salute e in malattia, all'opposizione e in maggioranza. 
Ripagato dai suoi con un collegio perso. Senza rete.
Spiace davvero.

